script: |
  super -f text -I q32.spq | sort > q32.out

inputs:
  - name: q32.spq
    data: |
      SELECT DISTINCT - - 35 + - - col2 + - col1 AS col2, + 45 + 25 / col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q32.out
    data: |
      1	46
      133	45
      24	45
